// src/pages/GalleryPage.tsx

import React from 'react';
import Header from '../components/Header';
import BottomNav from '../components/BottomNav';
import GalleryImage from '../components/GalleryImage'; // Assuming you have a GalleryImage component to display images

const GalleryPage: React.FC = () => {
  const images = [
    // Array of gallery image data (e.g., URLs or objects with metadata)
    { id: 1, url: '/path-to-image1.jpg', alt: 'Image 1' },
    { id: 2, url: '/path-to-image2.jpg', alt: 'Image 2' },
    { id: 3, url: '/path-to-image3.jpg', alt: 'Image 3' },
  ];

  return (
    <>
      <main className="flex flex-col items-center px-7 pb-16 mx-auto w-full max-w-7xl text-white bg-red-500 min-h-screen">
        <Header title="Gallery" />
        <div className="mt-6 grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 gap-4 w-full">
          {images.map((image) => (
            <GalleryImage key={image.id} imageUrl={image.url} alt={image.alt} />
          ))}
        </div>
      </main>
      <BottomNav />
    </>
  );
};

export default GalleryPage;
